bool MainContentComponent::isInterestedInFileDrag (const StringArray& files)  {
    if (!this->trashTread->isThreadRunning()) {
        for (auto i = 0; i <= files.size(); i++) {
            if (files[i].endsWith(".m3u")) {
                return true;
            }
        }
    }
    return false;
}
void MainContentComponent::filesDropped (const StringArray& files, int x, int y) {
    if (!this->trashTread->isThreadRunning()) {
        bool result = NativeMessageBox::showOkCancelBox(AlertWindow::AlertIconType::QuestionIcon, "Delete?", "do you really want to delete this playlists ...");
        if (result)
        {
            StringArray playlistFiles;
            for (auto i = 0; i <= files.size(); i++) {
                if (files[i].endsWith(".m3u")) {
                    File playlistFile(files[i]);
                    playlistFiles.add(playlistFile.getFullPathName());
                }
            }
            if (playlistFiles.size() > 0) {
                this->trashTread->start(playlistFiles);
            } else {
                this->status = ProgressStatus::drag;
                this->repaint();
            }
        }
    }
}

void MainContentComponent::handleMessage (const Message& message) {
    const TrashMessage* trashMessage = dynamic_cast<const TrashMessage*>(&message);
    this->status = trashMessage->status;
    this->message = trashMessage->message;
    this->repaint();
}
